    data: |
      SELECT DISTINCT - - CAST ( - 48 AS INTEGER ) + - + col0 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT + 45 - - col0 < col2 * + 42 + ( CAST ( 88 AS INTEGER ) ) / - 45;
  - name: tab0

outputs:
  - name: q3355.out
    data: |
